import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import {render} from "react-dom";
import LogInAdmin from "./components/LogInAdmin";
import SignUpAdmin from "./components/SignUpAdmin";
import LogInRegularUser from "./components/LogInRegularUser";
import SignUpRegularUser from "./components/SignUpRegularUser";

// const root = ReactDOM.createRoot(document.getElementById('root'));
// root.render(
//   <React.StrictMode>
//     <App />
//   </React.StrictMode>
// );

const rootElement = document.getElementById("root");

render(

    <BrowserRouter>
        <Routes>
            <Route path="/" element={<App />} />
            <Route path="/LogInAdmin" element={<LogInAdmin />} />
            <Route path="/SignUpAdmin" element={<SignUpAdmin />} />
            {/*<Route path="/CreateRestaurant" element={<CreateRestaurant />} />*/}
            {/*<Route path="/AdminActions" element={<AdminActions />} />*/}
            {/*<Route path="/CreateMenu" element={<CreateMenu />} />*/}
            {/*<Route path="/ViewMenu" element={<ViewMenu />} />*/}
            <Route path="/LogInRegularUser" element={<LogInRegularUser />} />
            <Route path="/SignUpRegularUser" element={<SignUpRegularUser />} />
            {/*<Route path="/CustomerActions" element={<CustomerActions />} />*/}
            {/*<Route path="/ViewRestaurants" element={<ViewRestaurants />} />*/}
            {/*<Route path="/ViewMenuCustomer" element={<ViewMenuCustomer />} />*/}
            {/*<Route path="/OrderCustomer" element={<OrderCustomer />} />*/}
        </Routes>
        {/*<App />*/}
    </BrowserRouter>,
    rootElement
);

reportWebVitals();
